additionalInfo.para:
In 2018-2021, hypolimnetic oxygenation water quality management occurred in Falling Creek Reservoir. For a detailed description of the hypolimnetic oxygenation engineered system, see Gerling et al. (2014). 
Below is the oxgenation schedule and when it was operating:
2018: 23 April-30 July; 9 August-10 September;
2019: 3 June-17 June; 8 July-19 July; 5 August-19 August; 2 September-1 December;
2020: 29 June-11 September; 25 September-2 December;
2021: 11 June-26 June; 26 July-14 September(different controller for oxygen-not sure how well it worked); 14 September-6 December(regular oxygen controller)
